// src/routes/Routes.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import App from '../components/App';
import Policies from '../components/Policies'; // Adjust the path if needed
import Users from '../components/Users'; // Create this component similarly
import Roles from '../components/Roles'; // Create this component similarly

const Routes = ({ loggedIn, handleLogin, handleLogout }) => (
  <Router>
    <Switch>
      <Route exact path="/">
        <App loggedIn={loggedIn} handleLogin={handleLogin} handleLogout={handleLogout} />
      </Route>
      <Route path="/policies">
        <Policies />
      </Route>
      <Route path="/users">
        <Users />
      </Route>
      <Route path="/roles">
        <Roles />
      </Route>
    </Switch>
  </Router>
);

export default Routes;
